export function ProductList(props) {
    console.log(props)
    return <div className="container">
        <h1>Shop</h1>

        <div className="row">
            <div className="col-md-6">
                <h3>Products</h3>
                <div className="row">
                {
                props.data.map(elm => {
                    return <div className="col-md-4my-4" key={elm.id} >
                     <img src={elm.image} style={{width:200,height:200}}/>
                     <p>{elm.title}</p>
                     <p><strong className="text-danger"> {elm.price} USD</strong></p>
                     <button onClick={()=>props.onMove(elm)}></button>

                    </div>
                })
            }
                </div>

            </div>

        </div>
    </div>
}
